DROP TABLE IF EXISTS "main"."ay_city";
CREATE TABLE "ay_city" (
  "id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
  "title" TEXT(100) NOT NULL,
  "stitle" TEXT(100),
  "etitle" TEXT(100) NOT NULL,
  "pid" INTEGER NOT NULL DEFAULT 0,
  "sorting" INTEGER(10) NOT NULL DEFAULT 255,
  "status" INTEGER NOT NULL DEFAULT 0,
  "istop" INTEGER NOT NULL DEFAULT 0,
  "isurl" TEXT(100),
  "seo_title" TEXT(200) NOT NULL,
  "seo_keywords" TEXT(200) NOT NULL,
  "seo_description" TEXT(500) NOT NULL,
  "contact" TEXT(50),
  "phone" TEXT(50),
  "fax" TEXT(50),
  "mobile" TEXT(50),
  "email" TEXT(50),
  "address" TEXT(100),
  "qq" TEXT(50),
  "wexin" TEXT(50)
);
